      <div className="image-row">
        <div className="image-box">Image</div>
        <div className="image-box">Image</div>
      </div>
      <Link to="/contact" className="book-button">Book Consultant</Link>
      <p className="service-text">
        AV & Production in event ticketing covers the planning, setup, and operation of audio, visual,
        and technical elements that bring an event to life. It includes sound systems, lighting, video
        screens, projection, and stage effects that enhance the audience's engagement. The production
        team ensures these elements work seamlessly with the eventâ€™s schedule and creative vision.
        In ticketed events, high-quality AV and production can greatly improve the attendee experience,
